import React from "react";
import './admin-css/add-items.css';
import Add_project from "./Add_project";
import Add_Skills from "./Add_skills";
import Add_about from "./Add_about";
import Add_colab from "./Add_collab";
import { useState } from "react";

export default function Add_items() {
    const [page, setpage] = useState(<Add_project/>);
    const [active, setactive] = useState('add_project');
    function set_skills() {
        setpage(<Add_Skills/>);
        setactive('add_skills');
    }
    function set_about() {
        setpage(<Add_about/>);
        setactive()
    }
    function set_colab() {
        setpage(<Add_colab/>);
    }
    function set_project() {
        setpage(<Add_project/>);
    }

    
    return(
        <>
            <div className="header">
                <div className="logo">
                    <h2>Dagos</h2>
                </div>
                <div className="item-menu">
                    <a href="/" ><p>2</p><svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 512 512"><path fill="#ffffff" d="M64 0C28.7 0 0 28.7 0 64V352c0 35.3 28.7 64 64 64h96v80c0 6.1 3.4 11.6 8.8 14.3s11.9 2.1 16.8-1.5L309.3 416H448c35.3 0 64-28.7 64-64V64c0-35.3-28.7-64-64-64H64z"/></svg></a>
                    <a href="/admin"><svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 512 512"><path fill="#ffffff" d="M377.9 105.9L500.7 228.7c7.2 7.2 11.3 17.1 11.3 27.3s-4.1 20.1-11.3 27.3L377.9 406.1c-6.4 6.4-15 9.9-24 9.9c-18.7 0-33.9-15.2-33.9-33.9l0-62.1-128 0c-17.7 0-32-14.3-32-32l0-64c0-17.7 14.3-32 32-32l128 0 0-62.1c0-18.7 15.2-33.9 33.9-33.9c9 0 17.6 3.6 24 9.9zM160 96L96 96c-17.7 0-32 14.3-32 32l0 256c0 17.7 14.3 32 32 32l64 0c17.7 0 32 14.3 32 32s-14.3 32-32 32l-64 0c-53 0-96-43-96-96L0 128C0 75 43 32 96 32l64 0c17.7 0 32 14.3 32 32s-14.3 32-32 32z"/></svg><a href="/"></a></a>
                </div>
            </div>

            <div className="add_item-body">
                <div className="add-item-main-box">
                    <div className="item_menu">
                        <button className="menu-active" onClick={set_project}>Add Project</button>
                        <button className="" onClick={set_colab}>Add Collaboration Works</button>
                        <button className="" onClick={set_skills}>Add Skills</button>
                        <button className="" onClick={set_about}>Add About me paragraph</button>
                    </div>
                    {page}
                </div>
            </div>

            {/* --------- Footer------- */}
            <div className="line"></div>
            <div className="footer">
                
                <div className="contents">
                    <p>All Right is received | 2024 </p>
                </div>
            </div>
        </>
    );
}
